 return (
  <div className='wrp-prix-profil'>
   <h2>${'120'} USD</h2>
   <h2>¢{'45045'} FC</h2>
   <h2 className='wrp-current-prix'>¢{'5000'} FC Disponible {`${new Date().getDay() + 13}`} - {`${new Date().getMonth()} +5`} -{`${new Date().getDay()}`}</h2>
  </div>
 );
